% load('ActVehAccel.mat') ActVehAccel N行2列数据，第一列为时间 第二列为数据
ActVehAccel = EstdVSELongtAcce
[N,rol] = size(ans)
dt = 0.01
Fs = 1 / dt
N = 1345
n = 0 : N -1
t = ActVehAccel.Time
f = n * Fs / N
Uc = ActVehAccel.Var1
% Wc = ActVehAccel(:,2) * 0.95
Wc = accelFirst.Data
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
y = fft(Uc, N)                     % 对载波信号进行傅里叶变换 
mag = abs(y)                       % 求得傅里叶变换后的振幅
cxf = mag / max(mag)               % 归一化 频率序列

% 相位谱
ph = 2 *  angle(y(1:N/2))
ph = ph * 180 / pi

%相关性
[a, b] = xcorr(Uc, Wc)


subplot(3,2,1);
plot(t,Uc);
title('载波信号波形');
xlabel('时间/s');
ylabel('幅度/V');
title('单音干扰信号波形');            % 载波信号波形图
% axis([0 0.009 -1 1]);

% 频谱
subplot(3,2,2); 
plot(f(1:N/2),cxf(1:N/2));
title('载波信号频谱'); 
axis([0 2 0 1]);
xlabel('频率/Hz');
ylabel('功率');
title('单音干扰信号归一化功率谱');     % Uc 数据频谱分布图
set(gca,'YTick',0:1:1);            % 设置功率谱坐标轴只有0和1

% 相位谱
subplot(3,2,3);
plot(f(1:N/2), ph(1:N/2))
xlabel('频率/Hz');
ylabel('相角');
title('相位谱');

% 相关性
subplot(3,2,4)
plot(b * dt, a)
title('相关性');                   % Uc 和 Wc 数据的相关性图谱

% 频率振幅
subplot(3,2,5);
plot(f, mag)
xlabel('频率/Hz');
ylabel('振幅/V');
title('频率振幅');                   % 随频率变化的振幅图谱
